import Widget from '@/components/Widget/Widget';

export default {
  name: 'Maps',
  data() {
    return {
      options: {},
    }
  },
  created() {
    this.$gmapApiPromiseLazy().then(() => {
      this.options = {
        mapTypeControl: true,
        mapTypeControlOptions: {
          style: google.maps.MapTypeControlStyle.DEFAULT
        }
      }
    })
  },
  components: { Widget }
};
